import './Messages.module.css';

const Messages = (props) => {
    return (
        <div className={s.dialogs}>
            <div className='dialogs-items'>
                <div className='dialog'>NikArt</div>
                <div className='dialog'>Andrey</div>
                <div className='dialog'>Anya</div>
                <div className='dialog'>Mama</div>
            </div>
            <div className='messages'>
                <div className="message">Hi</div>
                <div className="message">Good</div>
                <div className="message">All right</div>
                <div className='message'>Welcome</div>
            </div>
        </div>
    )
}

export default Messages;
